('BZ116', 'C-Class', 'C200 W205 AVANTGARDE 2.0 AT SEDAN', 'โฉม W205 ปี14-19\r\nC200 Avantgarde (CKD) 2,590,000 บาท\r\nอุปกรณ์มาตรฐาน\r\n- เครื่องยนต์เบนซินแถวเรียง 4 สูบ 1,991 cc.\r\n- กำลังสูงสุด 184 แรงม้า ที่ 5,500 rpm\r\n- แรงบิดสูงสุด 300 นิวตันเมตร ที่ 1,200-4,000 rpm\r\n- ระบบ ECO Start / Stop\r\n- เกียร์อัตโนมัติ 7 จังหวะ (7G-TRONIC PLUS)\r\n- ไฟเบรกกะพริบฉุกเฉิน\r\n- ถุงลมนิรภัยคู่หน้า2 ด้านข้าง 2 และม่านถุงลมนิรภัย \r\n- ระบบเบรก ADAPTIVE BRAKE\r\n- ระบบเบรกป้องกันล้อล็อค ABS\r\n- ระบบช่วยเบรก BAS\r\n- ระบบป้องกันล้อหมุนฟรี ASR\r\n- ระบบเตือนเพื่อนำรถเข้าศูนย์บริการ ASSYST\r\n- ระบบช่วยเตือนอาการเหนื่อยล้าขณะขับขี่\r\n- ระบบเตือนระดับผ้าเบรก\r\n- ระบบรักษาระดับความเร็ว (Cruise Control) \r\n- ระบบจำกัดความเร็ว (SPEEDTRONIC)\r\n- โปรแกรมควบคุมการทรงตัวอัตโนมัติ ESP\r\n- ไฟหน้าส่องสว่างอัตโนมัติในที่มืด\r\n- กระจกมองข้างพร้อมไฟเลี้ยว ปรับไฟฟ้า พร้อมระบบไล่ฝ้า\r\n- ระบบไล่ฝ้าที่กระจกหลังแบบหน่วงเวลา\r\n- กระจกหน้าต่างปรับขึ้น-ลงด้วยระบบไฟฟ้าทั้ง 4 บาน พร้อมระบบการทำงานแบบวันทัช\r\n- กุญแจรีโมทคอนโทรล ควบคุมด้วยคลื่นวิทยุ สั่งการทำงานเปิด-ปิดของเซ็นทรัลล็อก\r\n- ไฟท้าย แบบ LED\r\n- ระบบควบคุมอุณหภูมิอัตโนมัติแบบ THERMATIC\r\n- ระบบเตือนแรงดันลมยาง\r\n- ใบปัดน้ำฝนอัตโนมัติพร้อมเซ็นเซอร์วัดปริมาณน้ำฝน\r\n- ภายในตกแต่งด้วย Piano Black Trim\r\n- เบาะนั่งหุ้มหนัง ARTICO สีดำ\r\n- พวงมาลัย Multifunction\r\n- พวงมาลัยผ่อนแรงปรับความหนักตามความเร็วรถ\r\n- เบาะนั่งคนขับ กระจกข้าง และพวงมาลัย ปรับไฟฟ้า\r\n- เบาะนั่งผู้โดยสารด้านหน้าปรับไฟฟ้า\r\n- กระจกส่องหลังและกระจกข้างด้านคนขับลดแสงสะท้อนอัตโนมัติ\r\n- ระบบช่วยในการนำรถเข้าจอดอัตโนมัติ พร้อม PARKTRONIC\r\n- ระบบเปลี่ยนเกียร์ที่พวงมาลัย\r\n- ไฟหน้า LED High Performance\r\n- ไฟ daytime สำหรับการขับขี่ในเวลากลางวัน แบบ LED fibre-optic\r\n- วิทยุ-ซีดี MB Audio 20 พร้อม touchpad\r\n- Push Start Button\r\n- ระบบกันสะเทือนแบบ AGILITY CONTROL\r\n- ยางรถยนต์แบบ Run-flat tyres\r\n- ล้ออัลลอย 17 นิ้ว 5ก้าน\r\n- ยางหน้า/หลัง ขนาด 225/50 R17', '02', '615', '281', '0'),
('BZ117', 'C-Class', 'C300 W205 BLUE HYBRID EXCLUSIVE 2.1 AT DEDAN', 'C300 Bluetec Hybrid Exclusive (CKD) 2,840,000 บาท \r\n(สิ่งที่จะได้เพิ่มจากรุ่น C200 Avantgarde +250,000 บาท)\r\n- เครื่องยนต์ดีเซล แถวเรียง 4 สูบ 2,143 cc.\r\n- มอเตอร์ไฟฟ้า Hybrid\r\n- กำลังสูงสุด 204 แรงม้า ที่ 3,800 rpm\r\n- แรงบิดสูงสุด 500 นิวตันเมตร ที่ 1,600-1,800 rpm\r\n- กระจังหน้าลายแนวนอน\r\n- ตราสัญลักษณ์ Mercedes-Benz ที่ฝากระโปรงหน้า\r\n- เบาะนั่งคนขับ กระจกข้าง และพวงมาลัย ปรับไฟฟ้าพร้อมหน่วยความจำ\r\n- เบาะนั่งผู้โดยสารด้านหน้าปรับไฟฟ้าพร้อมหน่วยความจำ\r\n- ม่านบังแดดหลังปรับขึ้น-ลงด้วยระบบไฟฟ้า\r\n- ล้ออัลลอย 17 นิ้ว ลาย 20 ก้าน\r\n- กล้องแสดงภาพด้านหลัง ขณะถอยจอด\r\n- ถุงลมนิรภัยเพิ่มเติมซ้าย-ขวาสำหรับผู้โดยสารด้านหลัง\r\n- ระบบ PRE-SAFE\r\n- ระบบนำทางแผนที่ Garmin?\r\n- ไฟหน้าแบบ LED Intelligent Light System\r\n- ไฟตกแต่งภายในห้องโดยสาร (ปรับเลือกได้ 3 สี)\r\n- ฟังก์ชันปรับสมดุลอากาศภายในห้องโดยสาร', '02', '616', '281', '0'),
('BZ118', 'C-Class', 'C300 W205 BLUE HYBRID AMG 2.1 AT DEDAN', 'C300 Bluetec Hybrid AMG Dynamic (CKD) 3,090,000 บาท \r\n(สิ่งที่จะได้เพิ่มจากรุ่น C300 Bluetec Hybrid Exclusive +250,000 บาท)\r\n\r\n- พวงมาลัยมัลติฟังก์ชันแบบสปอร์ตท้ายตัด\r\n- เบาะนั่งคู่หน้าแบบสปอร์ต\r\n- ระบบปรับไฟสูงอัตโนมัติ (Adaptive Highbeam Assist)\r\n- ระบบเพิ่มความส่องสว่างขณะเลี้ยวโค้ง (Cornering Light)\r\n- ระบบปรับโคมไฟหน้ารถตามการเลี้ยวของพวงมาลัย (ALS-Active Light System)\r\n- ไฟเรืองเเสงล้อมรอบห้องโดยสาร\r\n- หลังคาแบบ พาโนรามิค เลื่อนเปิด-ปิดได้ด้วยระบบไฟฟ้า\r\n- ชุดแต่ง AMG Body Styling (กันชนหน้า-หลัง และสเกิร์ตข้าง)\r\n- ระบบกันสะเทือนแบบสปอร์ต\r\n- ชุดคันเร่งและแป้นเบรกแบบสปอร์ต\r\n- ดิสก์เบรกหน้าแบบมีช่องระบายความร้อน\r\n- สัญลักษณ์ Mercedes-Benz บนคาลิปเปอร์เบรกหน้า\r\n- ล้ออัลลอยดีไซน์สปอร์ตจาก AMG ขนาด 18\" \r\n- ยางด้านหน้า ขนาด 225/45 R18\r\n- ยางด้านหลัง ขนาด 245/40 R18\r\n- ระบบเสียงรอบทิศทาง Burmester (ลำโพง 11 ตัว และลำโพง Front Bass 2 ตัว)\r\n- ระบบกุญแจแบบ KEYLESS-GO \r\n- ฝากระโปรงหลัง เปิด-ปิดด้วยระบบไฟฟ้า', '02', '617', '281', '0'),
