('BZ144', 'CLA-Class', 'CLA250 AMG2.0 W117 Shooting Brake Sport Wagon AT(14-18)', '\"อุปกรณ์เสริมและอุปกรณ์ตกแต่ง เครื่องเล่น CD, USB, กระจกไฟฟ้า, เซ็นทรัลล็อค, พวงมาลัยพาวเวอร์, \r\nABS, AIRBAG, เบาะปรับไฟฟ้า, เบาะหนังแท้, แอร์ดิจิตอล, ไฟตัดหมอก, \r\nพวงมาลัย MULTIFUNCTION, CRUISE CONTROL, SUNROOF, จอ LCD กุญแจรีโมท', '02', '643', '283', '0'),
('BZ145', 'CLA-Class', 'CLA250 AMG2.0 W117 Dynamic Coupe AT(14-18)', 'Mercedes-Benz CLA250 AMG Dynamic\r\nเครื่องยนต์เบนซิน 2.0 ลิตร 4 สูบ เทอร์โบ ขุมพลัง 211 แรงม้า \r\nOption: Full Option \r\n? ชุดแต่ง AMG BodyStyling (หน้า-หลัง-ข้าง)\r\n? ล้ออัลลอยสปอร์ต AMG ขนาด 18\"\r\n? หลังคาแก้วไฟฟ้า Panoramic Sunroof\r\n? ไฟหน้า Daylight, ท่อโครเมียม 2 ท่อ\r\n? พวงมาลัยมัลติฟังก์ชั่น + Paddle Shift\r\n? Cruise Control, Park Sensor\r\n? ชุดคันเร่ง + แป้นเบรคสปอร์ต\r\n? กุญแจรีโมท ปุ่ม Push Start\r\n? เบาะหนังดำแท้สลับ Alcantara ปรับไฟฟ้า\r\n? จอมอนิเตอร์ 8\" วิทยุ ซีดี บูทูธ Apple Carplay\r\n? กระจกปรับไฟฟ้า , กระจกมองข้างปรับไฟฟ้า\r\n? แอร์ดิจิตอล, แอร์หลัง', '02', '644', '283', '0'),
('BZ146', 'CLK-Class', 'CLK200 Kompressor 1.8 W209 Avantgarde Coupe AT  (ปี 02-09)', 'เครื่องเล่น DVD, , กระจกไฟฟ้า, เซ็นทรัลล็อค, พวงมาลัยพาวเวอร์, ABS, AIRBAG, เบาะปรับไฟฟ้า, เบาะหนังแท้, แอร์ดิจิตอล, ไฟตัดหมอก, , พวงมาลัย MULTIFUNCTION,, SUNROOF, , PARK SENSOR,', '02', '645', '285', '0'),
('BZ147', 'E-Class', 'E250 CGI W207 ELEGANCE 1.8 AT SEDAN (10-16)', '++ รุ่นใหม่ Minor Change ตัว Top สุด\r\n++ E250 AMG + หลังคาแก้ว', '02', '646', '287', '0'),
('BZ148', 'E-Class', 'E200 W210 ELEGANCE 2.4 AT ', 'กระจกไฟฟ้า, เซ็นทรัลล็อค, พวงมาลัยพาวเวอร์, BAS/ABS/ระบบควบคุมเสถียรภาพการทรงตัวของรถ (ESP)/AIRBAG 8 ใบ ไฟตัดหมอก ,กระจกมองข้างปรับไฟฟ้า ,ไฟเลี้ยวที่กระจกมองข้าง ,ไมล์ดิจิตอล ,กุญแจรีโมท ,แอร์ดิจิตอล ,พวงมาลัยMultifunction , ระบบ Speed limit และ Cruse Control ,เบาะหนังแท้ปรับไฟฟ้า ,แอร์หลัง ,ม่านบังแดดหลังไฟฟ้า ,ภายในตกแต่งลายไม้ เกียร์ Tiptronic', '02', '647', '287', '0'),
('BZ149', 'E-Class', 'E250 CGI 1.8 W212 Sedan AT(ปี 10-16)', 'สีเบาะภายใน: เบาะหนังแท้สีดำ\r\n-ไฟหน้า Bi-xenon ปรับเลี้ยวตามพวงมาลัย\r\n-ม่านรอบคัน ม่านหลังไฟฟ้า\r\n-เบาะไฟฟ้าเต็มตัว พร้อมปุ่มความจำที่นั่งคนขับและคนนั่งข้าง \r\n- black ash wood ภายในตกแต่งด้วยลายไม้สีดำ\r\n-พวงมาลัย แบบ มัลติฟังค์ชั่น ปรับเสียง รับโทรศัพท์ได้จากพวงมาลัย \r\n-จอcommand 7 นิ้ว ดูDVD ได้ ฟังเพลงเชื่อมต่อbluetooth ได้\r\n-ช่องใส่CD 6 แผ่น พร้อมใช้งานแบบอัติโนมัติ\r\n-ระบบ sensor รอบคัน\r\n-ระบบจำกัดความเร็วการขับขี่ Criuse Control \r\n- Airbag รอบคัน\r\n**ใช้ได้ทั้งตัว Sedan และ VAN**', '02', '648', '287', '0'),
('BZ150', 'รถทัวร์', 'BENZ ม.2 (ข) ', 'รถบัส 1 ชั้น ปรับอากาศ\r\n', '04', '649', '303', '0'),
('BZ151', 'รถทัวร์', 'BENZ ม.4 (ข) ', 'รถบัส ม.4(ข) แบบสองชั้นเครื่องยนต์320 แรงม้า แชสซีเก่าขึ้นโครงใหม่ จดทะเบียนใหม่ ช่วงล่างแบบถุงลม มีห้องน้ำในรถ ระบบเครื่องเสียงไฟฟ้าและเครื่องปรับอากาศแบบไฟฟ้า\r\n', '04', '650', '303', '0'),
('BZ152', 'S-Class', 'S320 (W140) 3.2AT (1991-1998)', 'กระจกไฟฟ้า \r\nเซ็นทรัลล็อค\r\nพวงมาลัยพาวเวอร์\r\nABS, AIRBAG, \r\nเบาะปรับไฟฟ้า, เบาะหนังแท้\r\nแอร์ดิจิตอล\r\nหลังคาซันรูป **รุ่นที่ไม่มีหลังคาซันรูฟให้ลดยอดจัดลงอีก20,000**', '02', '3936', '297', '0'),
('BZ153', 'E-Class', 'E220 CDI 2.1 W211 Elegance Wagon AT (ปี 03-09)', 'เครื่องดีเซล spec ELEGANCE รุ่นพิเศษ ESTATE CDI ตัวแวน ฝาท้ายเปิดปิดไฟฟ้า เครื่องยนต์ดีเซล, แอร์ดิจิตอล, ล้อแมกซ์, ABS, Airbag,พ.พาวเวอร์, กุญแจรีโมท ,ไมล์ดิจิตอล ,เบาะหนังแท้ปรับไฟฟ้า ,ภายในลายไม้,แอร์หลัง ,Multifunction ,Cruse Control ,Park Sensor ,กระจกมองข้างปรับไฟฟ้า ,ไฟเลี้ยวที่กระจกมองข้าง ,ไฟตัดหมอก', '02', '4000', '287', '0'),
('BZ154', 'E-Class', 'E240 2.6 W211 (ปี 03-09) Avantgarde Sedan AT', 'แอร์ CD USB กระจกไฟฟ้า เซ็นทรัลล็อค กระจกมองข้างปรับไฟฟ้า พวงมาลัยพาวเวอร์ ABS / AIRBAG เบาะหนังแท้ เบาะปรับไฟฟ้า+MEMORY แอร์ดิจิตอล พวงมาลัยMultifunction Cruise Control แอร์หลัง ภายในตกแต่งลายไม้ กุญแจรีโมท ไฟตัดหมอก Park Sensor Full Option', '02', '4012', '287', '0'),
