('FD110', 'FOCUS', 'FOCUS 5DR 2.0L Ti-VCT GDI SPORT AT (12-16)', 'ฟอร์ด โฟกัส 5 ประตู 2.0L Ti-VCT GDi Sport 6-Speed 969,000.\r\nอุปกรณ์มาตรฐาน เพิ่มเติมจากรุ่น Trend\r\nเครื่องยนต์และระบบส่งกำลัง\r\n- Duratec 2.0L Ti-VCT GDi กำลังสูงสุด 170 แรงม้า แรงบิดสูงสุด 202 นิวตัน-เมตร\r\n- เกียร์อัตโนมัติ PowerShift 6 สปีด\r\nอุปกรณ์เพื่อความสะดวกสบาย\r\n- กระจกมองข้างพับไฟฟ้าพร้อมไฟส่องสว่างข้างตัวรถ\r\n- กระจกไฟฟ้าพร้อมกดขึ้น-ลงสัมผัสเดียวทุกบาน\r\n+ ระบบปรับอากาศอัตโนมัติแบบแยกอิสระซ้าย-ขวา\r\n- ไฟตกแต่งภายในห้องโดยสาร\r\n- พวงมาลัย / หัวเกียร์ หุ้มหนัง\r\n- กุญแจรีโมทอัจฉริยะพร้อมปุ่มสตาร์ทรถอัตโนมัติ Ford Power Start\r\n- ระบบเครื่องเสียงแบบพรีเมี่ยมยี่ห้อ Sony พร้อมลำโพง 9 ตัว\r\nความปลอดภัย\r\n- สัญญาณเตือนระยะถอยหลัง\r\n- ระบบสัญญาณกันขโมย\r\n- ถุงลมนิรภัยด้านข้าง\r\nอุปกรณ์เฉพาะรุ่น 5 ประตู Sport\r\n- ไฟท้ายพร้อมแถบ LED\r\n- สปอยเลอร์หลังแบบสปอร์ตขนาดใหญ่\r\n- กันชนหน้า / หลังส่วนล่างสีเดียวกับตัวรถ\r\n- สเกิร์ตด้านข้าง\r\n- เบาะนั่งกึ่งผ้ากึ่งหนังแบบสปอร์ต สีดำ\r\n- ล้ออัลลอย 17? พร้อมยาง 215/50 R17', '02', '942', '423', '0'),
