('FD113', 'ESCAPE', 'ESCAPE 2.3 4WD XLT PLUS AT    (2012)', 'ESCAPE 2.3 2WD XLS AT              1,099,000.-\r\nESCAPE 2.3 2WD XLT PLUS AT    1,179,000.-\r\n\r\nภาพรวม\r\nฟอร์ด เอสเคป E20 4x4 XLT+ แรงด้วยขุมพลังเครื่องยนต์ ดูราเทค 2.3 ลิตร ใช้ได้กับน้ำมัน E20 พร้อมระบบวาล์วแปรผัน VVT (Variable Valve Timing) และระบบควบคุมคันเร่ง ETCS?Electrical Throttle Control System (Drive by Wire) ที่ตอบสนองทุกจังหวะการขับขี่อย่างทรงพลังและประหยัดน้ำมันเป็นเยี่ยม ยิ่งไปกว่านั้น ฟอร์ด เอสเคป รุ่น 4x4 XLT+ ยังโดดเด่นด้วยรูปลักษณ์ภายนอกสไตล์ออฟโรด พร้อมอุปกรณ์ตกแต่งพิเศษ และยังพร้อมสรรพไปด้วยระบบรักษาความปลอดภัยครบครัน อาทิ ระบบเบรกป้องกันล้อล็อก, ระบบกระจายแรงเบรก, ระบบช่วยเบรก, เซ็นเซอร์ช่วยจอดรถ, หลังคาซันรูฟ และระบบป้องกันเครื่องยนต์พร้อมสัญญาณกันขโมย \r\n\r\nคุณลักษณะอันโดดเด่น\r\nเครื่องยนต์ 2.3 ลิตร Duratec 4 สูบ 16 วาล์วพร้อมระบบ VVT \r\nระบบ 4WD On Demand Control Trac II \r\nเกียร์อัตโนมัติ 4 จังหวะ พร้อม Overdrive ควบคุมด้วยอิเล็กทรอนิกส์ \r\nพวงมาลัยชนิด แร็คแอนด์พิเนียน พร้อมพาวเวอร์ช่วยผ่อนแรง มีระบบปรับน้ำหนัก พวงมาลัยตามความเร็ว \r\nระบบควบคุมความเร็วอัตโนมัติ \r\nล้ออัลลอยขนาด 16 นิ้ว \r\nหลังคาซันรูฟ \r\nเบาะหนังและพวงมาลัยหุ้มหนัง \r\nถุงลมนิรภัยคู่หน้า และด้านข้าง \r\nระบบเบรก ABS และระบบกระจายแรงเบรก EBD \r\nอุปกรณ์ตกแต่งพิเศษ\r\nสเกิร์ตด้านข้าง \r\nสเตนเลสหุ้มชายประตู \r\nโลโก้โครเมียมข้างประตู \r\nแผงกันกระแทกใต้กันชนหลัง \r\nสปอยเลอร์หลัง \r\nปลายท่อไอเสียโครเมียม', '02', '944', '417', '0'),
('FD114', 'ESCAPE', 'ESCAPE 2.3 2WD XLT PLUS AT   (2012)', 'เครื่องเล่น CD, กระจกไฟฟ้า, เซ็นทรัลล็อค, พวงมาลัยพาวเวอร์,ABS,AIRBAG, แอร์ดิจิตอล, ไฟตัดหมอก, CRUISE CONTROL, พวงมาลัย MULTIFUNCTION, SUNROOF, PARK SENSOR, FULL OPTION\"\r\nภาพรวม\r\nฟอร์ด เอสเคป E20 4x2 XLT+ แรงด้วยขุมพลังเครื่องยนต์ ดูราเทค 2.3 ลิตร ใช้ได้กับน้ำมัน E20 พร้อมระบบวาล์วแปรผัน VVT (Variable Valve Timing) และระบบควบคุมคันเร่ง ETCS - Electrical Throttle Control System (Drive by Wire) ที่ตอบสนองทุกจังหวะการขับขี่อย่างทรงพลังและประหยัดน้ำมันเป็นเยี่ยม ยิ่งไปกว่านั้น ฟอร์ด เอสเคป รุ่น 4x2 XLT+ ยังโดดเด่นด้วยรูปลักษณ์ภายนอกสไตล์ออฟโรด พร้อมอุปกรณ์ตกแต่งพิเศษ และยังพร้อมสรรพไปด้วยระบบรักษาความปลอดภัยครบครัน อาทิ ระบบเบรกป้องกันล้อล็อก, ระบบกระจายแรงเบรก, ระบบช่วยเบรก, เซ็นเซอร์ช่วยจอดรถ, หลังคาซันรูฟ และระบบป้องกันเครื่องยนต์พร้อมสัญญาณกันขโมย \r\n\r\nคุณลักษณะอันโดดเด่น\r\nเครื่องยนต์ 2.3 ลิตร Duratec 4 สูบ 16 วาล์วพร้อมระบบ VVT \r\nเกียร์อัตโนมัติ 4 จังหวะ พร้อม Overdrive ควบคุมด้วยอิเล็กทรอนิกส์ \r\nพวงมาลัยชนิด แร็คแอนด์พิเนียน พร้อมพาวเวอร์ช่วยผ่อนแรง มีระบบปรับน้ำหนัก พวงมาลัยตามความเร็ว \r\nระบบควบคุมความเร็วอัตโนมัติ \r\nล้ออัลลอยขนาด 16 นิ้ว \r\nหลังคาซันรูฟ \r\nเบาะหนังและพวงมาลัยหุ้มหนัง \r\nถุงลมนิรภัยคู่หน้า และด้านข้าง \r\nระบบเบรก ABS และระบบกระจายแรงเบรก EBD \r\nอุปกรณ์ตกแต่งพิเศษ\r\nสเกิร์ตด้านข้าง \r\nสเตนเลสหุ้มชายประตู \r\nโลโก้โครเมียมข้างประตู \r\nแผงกันกระแทกใต้กันชนหลัง \r\nสปอยเลอร์หลัง \r\nปลายท่อไอเสียโครเมียม', '02', '945', '417', '0'),
('FD115', 'ESCAPE', 'ESCAPE 2.3 2WD XLS AT   (2012)', 'เครื่องเล่น CD, USB, กระจกไฟฟ้า, เซ็นทรัลล็อค, พวงมาลัยพาวเวอร์, ABS, AIRBAG\r\nภาพรวม\r\nยนตรกรรม ฟอร์ด เอสเคป ใหม่ 2.3L 4x2 XLS นั้นออกแบบมาเพื่อผู้หลงใหลในการขับขี่อย่างแท้จริง ขุมพลังเครื่องยนต์ 2.3 ลิตร 4 สูบพร้อมระบบวาล์วแปรผัน VVT (Variable Valve Timing) และระบบควบคุมคันเร่ง ETCS?Electrical Throttle Control System (Drive by Wire) ทำงานสอดประสานได้อย่างสมบูรณ์แบบกับระบบรองรับอิสระและระบบเบรกประสิทธิภาพสูงอันประกอบไปด้วย ดิสก์เบรก 4 ชิ้นพร้อมระบบเบรกป้องกันล้อล็อก, ระบบกระจายแรงเบรก และระบบช่วยเบรก ฟอร์ด เอสเคป XLS พร้อมมอบความมั่นใจเต็มเปี่ยมและประสบการณ์การขับขี่อันยอดเยี่ยมแด่คุณทุกเส้นทาง และยังสามารถใช้ได้กับน้ำมัน E20 ได้อีกด้วย\r\n\r\nคุณลักษณะอันโดดเด่น\r\nเครื่องยนต์ 2.3 ลิตร Duratec 4 สูบ 16 วาล์วพร้อมระบบ VVT (ใช้ได้กับน้ำมัน E20)\r\nระบบเบรก ABS 4 Sensor 4 Channel และระบบกระจายแรงเบรก EBD \r\nพวงมาลัยชนิด แร็คแอนด์พิเนียน พร้อมพาวเวอร์ช่วยผ่อนแรง มีระบบปรับน้ำหนัก พวงมาลัยตามความเร็ว \r\nล้ออัลลอยขนาด 16 นิ้ว', '02', '946', '417', '0');
INSERT INTO `model_detl` (`MDDT_CODE`, `MD_NAME`, `MDDT_NAME`, `MDDT_DESC`, `CAR_TYPE_CODE`, `ID`, `MODEL_ID`, `INACTIVE`) VALUES
('FD116', 'EVEREST', 'EVEREST 2.5 XLT MT 2WD (09-13)', 'Everest รุ่น 2.5L 4X2 XLT ดีเซล ดูราทอร์ค คอมมอนเรล เกียร์ธรรมดา 5 จังหวะ ราคา 989,000 บาท \r\n\r\nคุณลักษณะอันโดดเด่น\r\nเครื่องยนต์ ดูราทอร์ค คอมมอนเรล 2.5 ลิตร เทอร์โบแปรผัน อินเตอร์คูลเลอร์ DOHC 16 วาล์ว ECU 32 บิต เทคโนโลยีจาก BOSCH เยอรมัน \r\nระบบกันสะเทือนหน้า อิสระปีกนกคู่ ทอชั่นบาร์ / หลัง แหนบซ้อน โช้กอัพไขว้ พร้อมเหล็กกันโคลงหน้า-หลัง \r\nเกียร์ธรรมดา 5 สปีด\r\nรัศมีวงเลี้ยวแคบสุด 6.1 เมตร \r\nระบบเบรก ABS พร้อมระบบกระจายแรงเบรกแบบอิเล็กทรอนิค EBD และ G - Sensor \r\nถุงลมนิรภัยคู่หน้า พร้อมคานเหล็กนิรภัยด้านข้าง\r\nเข็มขัดนิรภัยแบบดึงกลับและผ่อนแรงอัตโนมัติ \r\nกุญแจรีโมท\r\nล้ออัลลอย 16 นิ้ว พร้อมยาง 245 / 70 R16 \r\nกระจกมองข้างไฟฟ้าพับได้ พร้อมไฟเลี้ยวในตัวแบบ LED\r\nราวหลังคา / ไฟเบรกดวงที่ 3\r\nเบาะกำมะหยี่ 3 แถว ปรับพับอิสระ เบาะแถวที่ 2 พับเก็บได้ในจังหวะเดียว เบาะแถวที่ 3 สามารถถอดได้\r\nระบบปรับอากาศแบบ 3 ตอนแยกปรับทิศทางอิสระ\r\nเครื่องเล่น วิทยุ CD/MP 1 แผ่น แบบบิวท์อิน พร้อมลำโพง 4 ตัว', '02', '947', '419', '0'),
('FD118', 'EVEREST', 'EVEREST 2.5 LTD NAVI AT 2WD (09-13)', 'คุณลักษณะอันโดดเด่น\r\nเครื่องยนต์ ดูราทอร์ค คอมมอนเรล 2.5 ลิตร เทอร์โบแปรผัน อินเตอร์คูลเลอร์ DOHC 16 วาล์ว ECU 32 บิต เทคโนโลยีจาก BOSCH เยอรมัน \r\nระบบกันสะเทือนหน้า อิสระปีกนกคู่ ทอชั่นบาร์ / หลัง แหนบซ้อน โช้กอัพไขว้ พร้อมเหล็กกันโคลงหน้า-หลัง \r\nเกียร์อัตโนมัติ 5 สปีด\r\nรัศมีวงเลี้ยวแคบสุด 6.1 เมตร \r\nระบบเบรก ABS พร้อมระบบกระจายแรงเบรกแบบอิเล็กทรอนิค EBD และ G - Sensor \r\nถุงลมนิรภัย 4 จุด คู่หน้าและด้านข้าง พร้อมคานเหล็กนิรภัยด้านข้าง\r\nเข็มขัดนิรภัยแบบดึงกลับและผ่อนแรงอัตโนมัติ \r\nกุญแจรีโมท / ระบบป้องกันการโจรกรรม / กุญแจนิรภัย Immobillizer\r\nล้ออัลลอย 18 นิ้ว พร้อมยาง 255/60 R18 \r\nกระจกมองข้างไฟฟ้าพับได้ พร้อมไฟเลี้ยวในตัวแบบ LED และไฟส่องสว่างข้างตัวรถ\r\nไฟตัดหมอกหน้า \r\nบันไดข้าง / ราวหลังคา / ไฟเบรกดวงที่ 3\r\nเบาะหนัง 3 แถว ปรับพับอิสระ เบาะแถวที่ 2 พับเก็บได้ในจังหวะเดียว เบาะแถวที่ 3 สามารถถอดได้\r\nระบบปรับอากาศแบบ 3 ตอนแยกปรับทิศทางอิสระ\r\nระบบสัญญาณเตือนสิ่งกีดขวางขณะถอยหลัง\r\nเครื่องเล่น วิทยุ DVD/CD/MP ขนาด 2DIN พร้อมจอทัชสกรีนจาก Alpine และลำโพง 6 ตัว\r\nระบบนำทางด้วยดาวเทียม (GPS Navigation System)\r\nจอมอนิเตอร์ติดตั้งเพดานขนาดใหญ่\r\nกล้องมองหลังทำงานอัตโนมัติเมื่อเข้าเกียร์ถอย\r\nแป้นเหยียบแบบสปอร์ต \r\nคิ้วขอบประตูแบบเรืองแสง\r\nสปอยเลอร์หลัง\r\nกาบตกแต่งข้างประตู', '02', '948', '419', '0'),
('FD119', 'EVEREST', 'EVEREST 3.0 LTD NAVI AT 4WD (09-13)', 'คุณลักษณะอันโดดเด่น\r\nเครื่องยนต์ ดูราทอร์ค คอมมอนเรล 3.0 ลิตร เทอร์โบแปรผัน อินเตอร์คูลเลอร์ DOHC 16 วาล์ว ECU 32 บิต เทคโนโลยีจาก BOSCH เยอรมัน \r\nระบบขับเคลื่อน 4 ล้อ พร้อมระบบ Active Shift on The Fly แบบปุ่มบิดควบคุมด้วยไฟฟ้า\r\nระบบกันสะเทือนหน้า อิสระปีกนกคู่ ทอชั่นบาร์ / หลัง แหนบซ้อน โช้กอัพไขว้ พร้อมเหล็กกันโคลงหน้า-หลัง \r\nเกียร์อัตโนมัติ 5 สปีด\r\nรัศมีวงเลี้ยวแคบสุด 6.1 เมตร \r\nลิมิเต็ดสลิปแบบสองทาง \r\nระบบเบรก ABS พร้อมระบบกระจายแรงเบรกแบบอิเล็กทรอนิค EBD และ G - Sensor \r\nถุงลมนิรภัย 4 จุด คู่หน้าและด้านข้าง พร้อมคานเหล็กนิรภัยด้านข้าง\r\nเข็มขัดนิรภัยแบบดึงกลับและผ่อนแรงอัตโนมัติ \r\nกุญแจรีโมท / ระบบป้องกันการโจรกรรม / กุญแจนิรภัย Immobillizer\r\nล้ออัลลอย 18 นิ้ว พร้อมยาง 255/60 R18 \r\nกระจกมองข้างไฟฟ้าพับได้ พร้อมไฟเลี้ยวในตัวแบบ LED และไฟส่องสว่างข้างตัวรถ\r\nไฟตัดหมอกหน้า \r\nบันไดข้าง / ราวหลังคา / ไฟเบรกดวงที่ 3\r\nเบาะหนัง 3 แถว ปรับพับอิสระ เบาะแถวที่ 2 พับเก็บได้ในจังหวะเดียว เบาะแถวที่ 3 สามารถถอดได้\r\nระบบปรับอากาศแบบ 3 ตอนแยกปรับทิศทางอิสระ\r\nระบบสัญญาณเตือนสิ่งกีดขวางขณะถอยหลัง\r\nเครื่องเล่น วิทยุ DVD/CD/MP ขนาด 2DIN พร้อมจอทัชสกรีนจาก Alpine และลำโพง 6 ตัว\r\nระบบนำทางด้วยดาวเทียม (GPS Navigation System)\r\nจอมอนิเตอร์ติดตั้งเพดานขนาดใหญ่\r\nกล้องมองหลังทำงานอัตโนมัติเมื่อเข้าเกียร์ถอย\r\nแป้นเหยียบแบบสปอร์ต \r\nคิ้วขอบประตูแบบเรืองแสง\r\nสปอยเลอร์หลัง\r\nกาบตกแต่งข้างประตู', '02', '949', '419', '0'),
('FD120', 'RANGER DOUBLE CAB', 'RANGER DOUBLE CAB LIMITED 3.0 TDCI 4WD (06-08)', 'ABS AIRBAG 4 ใบ พ.พาวเวอร์ ก.ไฟฟ้า ก.มองข้างปรับไฟฟ้า พ.พาวเวอร์ ซ.ล็อก เบาะหนังแท้\r\n', '01', '950', '428', '0'),
('FD121', 'RANGER DOUBLE CAB', 'RANGER DOUBLE CAB XLT 3.0 TDCI 4WD (06-08)', 'ABS AIRBAG 2 ใบ พ.พาเวอร์ ก.ไฟฟ้า ซ.ล็อก เบาะหนังแท้/กำมะหยี่  ก.มองข้างปรับไฟฟ้า', '01', '951', '428', '0'),
('FD122', 'ESCAPE', 'ESCAPE XLS 2.3', 'โฉมปี 2003-2006 ABS AIRBAG พ.พาวเวอร์\r\nก.ไฟฟ้า ซ.ล็อก เบาะกำมะหยี่\r\nก.มองข้างปรับไฟฟ้า กุญแจรีโมท ไมล์ดิจิตอล\r\nเปลี่ยนโฉมปี 2007-2009', '02', '952', '417', '0'),
