('FD185', 'RANGER DOUBLE CAB', 'RANGER DOUBLE CAB Hi-RIDER WILDTRAK 2.2 MT (12-15)', 'อุปกรณ์สำหรับรุ่น 2.2L Wildtrak\r\nเฟืองท้ายแบบลิมิเต็ดสลิป\r\nไฟส่องสว่างข้างตัวรถ\r\nสปอร์ตบาร์ และราวหลังคา\r\nราวเสริมขอบกระบะท้าย\r\nพื้นปูกระบะท้าย\r\nสวิตช์ควบคุมเครื่องเสียงบนพวงมาลัย\r\nระบบควบคุมความเร็วอัตโนมัติ\r\nระบบเชื่อมต่อบลูทูธ และ ระบบสั่งงานด้วยเสียง\r\nช่องต่อ USB\r\nลำโพง 6 ตัว', '01', '1015', '428', '0'),
('FD186', 'RANGER', 'RANGER SINGLE 2.2 XL (15-18)', 'รุ่น XL ? อุปกรณ์มาตรฐาน :สแตนดาร์ตแค็บ\r\n- 2.2L VG Turbo 6MT 559,000.-\r\nเครื่องยนต์\r\n- เครื่องยนต์ดีเซล TDCi ขนาด 2.2 มิลลิลิตร พร้อม Turbo Intercooler\r\nกำลังสูงสุด 125 แรงม้า, แรงบิดสูงสุด 320 นิวตันเมตร\r\n- เครื่องยนต์ดีเซล TDCi ขนาด 2.2 มิลลิลิตร พร้อม VG Turbo Intercooler\r\nกำลังสูงสุด 150 แรงม้า, แรงบิดสูงสุด 375 นิวตันเมตร (สำหรับรุ่น VG Turbo )\r\nขนาดล้อและยาง\r\n- ล้อกระทะเหล็ก 16? พร้อมยางขนาด 215/70 R16\r\n- ล้ออัลลอย 16? พร้อมยางขนาด 255/70 R16 (สำหรับรุ่น Hi-Rider)\r\nอุปกรณ์ภายนอก\r\n- กระจังหน้า มือจับประตู และกระจกมองข้าง สีดำ\r\n- กันชนหน้า สีเดียวกับตัวรถ (เฉพาะรุ่นโอเพ่นแค็บ)\r\n- ไฟเลี้ยวข้างตัวรถ\r\nอุปกรณ์ภายในและความสะดวกสบาย\r\n- กระจกมองข้างแบบปรับไฟฟ้า (เฉพาะรุ่นโอเพ่นแค็บ)\r\n- หน้าต่างปรับไฟฟ้าพร้อมระบบเปิด-ปิดแบบสัมผัสเดียวด้านคนขับ (เฉพาะรุ่นโอเพ่นแค็บ)\r\n- ไฟส่องสว่างในห้องโดยสาร\r\n- ระบบปรับอากาศ\r\n- เซ็นทรัลล็อค\r\n- เบาะนั่งด้านหน้าแบบแถวยาว แยกพับ 60/40 (เฉพาะรุ่นสแตนดาร์ดแค็บ)\r\n- ช่องเก็บของเหนือศรีษะพร้อมไฟอ่านแผนที่ (เฉพาะรุ่นโอเพ่นแค็บ)\r\n- ช่องต่อไฟ 12v จำนวน 2 จุด\r\n- วิทยุ พร้อมช่องต่อ AUX\r\n- ช่องต่อ USB\r\n- ระบบเชื่อมต่อบลูทูธ\r\nความปลอดภัย\r\n- ถุงลมนิรภัยคู่หน้า\r\n- เข็มขัดนิรภัยคู่หน้า พร้อมระบบดึงกลับและผ่อนแรงอัตโนมัติ\r\n- ระบบกุญแจนิรภัย (Immobilizer)', '01', '1016', '427', '0'),
