('FD223', 'EVEREST', 'EVEREST 3.2L Titanium SUV AT 4WD', 'New Ford Everest 3.2 Titanium Plus 4WD A/T 2016 \r\nราคา 1,749,000 บาท \r\n-หลังคา Panoramic Moonroof แบบปรับไฟฟ้า\r\n-AIRBAG 7 ใบ\r\n-ระบบควบคุมความเร็วอัตโนมัติแบบรักษาระยะห่าง Adaptive Cruise Control\r\n-ระบบเตือนการชนด้านหน้า Forward Collision Warning System\r\n-ระบบช่วยรักษารถให้อยู่ในช่องจราจร Lane Keeping System\r\n-ระบบเปิด-ปิดไฟสูงอัจฉริยะ Auto High Beam Control\r\n-ระบบช่วยเตือนการเหนื่อยล้าขณะขับขี่ Driver Alert System \r\n-ระบบสั่งงานด้วยเสียง\r\n-จอ DVD Bluetooth กล้องมองหลังขณะถอยจอด \r\n-เบาะหนังแท้ คู่หน้าปรับไฟฟ้า\r\n\"อุปกรณ์เสริมและตกแต่ง\"\r\n\r\nเครื่องเล่น CD USB กระจกไฟฟ้า เซ็นทรัลล็อค พวงมาลัยพาวเวอร์ ABS / AIRBAG เบาะหนังแท้ เบาะปรับไฟฟ้า แอร์ดิจิตอล พวงมาลัย Multifunction Cruse Control จอNavi แอร์หลัง กล้องหลัง บันไดข้าง กันสาด หลังคาSUNROOF กุญแจรีโมท ไฟตัดหมอกชุดแต่งรอบคัน', '02', '1053', '419', '0'),
('FD224', 'FIESTA', 'FIESTA 5DR 1.0L EcoBoot Sport AT', 'เครื่องยนต์และระบบส่งกำลัง\r\n1.0L EcoBoost กำลังสูงสุด 125 แรงม้า แรงบิดสูงสุด 170 นิวตัน-เมตร\r\nเกียร์อัตโนมัติ PowerShift 6 สปีด\r\n ภายนอก\r\nไฟตัดหมอกหน้า\r\nกระจกมองข้างพับไฟฟ้าพร้อมไฟเลี้ยว\r\nไฟส่องสว่างข้างตัวรถ\r\nขอบหน้าต่างโครเมียม\r\nระบบเปิด-ปิดไฟหน้าอัตโนมัติ\r\nระบบปัดน้ำฝนแบบอัตโนมัติ\r\nล้ออัลลอย 16? พร้อมยาง 195 / 50R16\r\nสเกิร์ตหน้า-หลัง\r\nสปอยเลอร์หลัง\r\n ภายใน\r\nกุญแจรีโมทอัจฉริยะพร้อมปุ่มสตาร์ทรถอัตโนมัติ Ford Power Start\r\nเบาะนั่งด้านหน้าแบบสปอร์ต\r\nเบาะกึ่งผ้ากึ่งหนัง\r\nพวงมาลัยหุ้มหนัง\r\nไฟตกแต่งห้องโดยสาร\r\nระบบปรับอากาศอัตโนมัติ\r\nเครื่องเสียง\r\nวิทยุพร้อมเครื่องเล่น 1 CD / MP3\r\nช่องต่อ USB & AUX\r\nระบบสั่งด้วยเสียง SYNC พร้อมการเชื่อมต่อ Bluetooth\r\nลำโพง 6 ตัว\r\nสวิตช์ควบคุมระบบเครื่องเสียงบนพวงมาลัย\r\nจอแสดงผลข้อมูลอเนกประสงค์ขนาดใหญ่\r\nความปลอดภัย\r\nระบบป้องกันล้อล็อค ABS\r\nระบบควบคุมเสถียรภาพการทรงตัว ESP พร้อมระบบช่วยการออกตัวขณะจอดบนทางลาดชัน (Hill Launch Assist)\r\nถุงลมนิรภัยด้านคนขับและผู้โดยสารตอนหน้า\r\nระบบกุญแจนิรภัย Immobilizer\r\nสัญญาณเตือนระยะถอยหลัง', '02', '1054', '422', '0'),
('FD225', 'FIESTA', 'FIESTA 4DR 1.0L EcoBoot Titanium AT', 'อุปกรณ์มาตรฐาน\r\nเครื่องยนต์และระบบส่งกำลัง\r\n1.0L EcoBoost กำลังสูงสุด 125 แรงม้า แรงบิดสูงสุด 170 นิวตัน-เมตร\r\nเกียร์อัตโนมัติ PowerShift 6 สปีด\r\nภายนอก\r\nไฟตัดหมอกหน้า\r\nกระจกมองข้างพับไฟฟ้าพร้อมไฟเลี้ยว\r\nไฟส่องสว่างข้างตัวรถ\r\nขอบหน้าต่างโครเมียม\r\nระบบเปิด-ปิดไฟหน้าอัตโนมัติ\r\nระบบปัดน้ำฝนแบบอัตโนมัติ\r\nล้ออัลลอย 16? พร้อมยาง 195 / 50R16\r\n ภายใน\r\nกุญแจรีโมทอัจฉริยะพร้อมปุ่มสตาร์ทรถอัตโนมัติ Ford Power Start\r\nเบาะนั่งด้านหน้าแบบสปอร์ต\r\nเบาะหนัง\r\nพวงมาลัยหุ้มหนัง\r\nไฟตกแต่งห้องโดยสาร\r\nระบบปรับอากาศอัตโนมัติ\r\nเครื่องเสียง\r\nวิทยุพร้อมเครื่องเล่น 1 CD / MP3\r\nช่องต่อ USB & AUX\r\nระบบสั่งด้วยเสียง SYNC พร้อมการเชื่อมต่อ Bluetooth\r\nลำโพง 6 ตัว\r\nสวิตช์ควบคุมระบบเครื่องเสียงบนพวงมาลัย\r\nจอแสดงผลข้อมูลอเนกประสงค์ขนาดใหญ่\r\nความปลอดภัย\r\nระบบป้องกันล้อล็อค ABS\r\nระบบควบคุมเสถียรภาพการทรงตัว ESP พร้อมระบบช่วยการออกตัวขณะจอดบนทางลาดชัน (Hill Launch Assist)\r\nถุงลมนิรภัยด้านคนขับและผู้โดยสารตอนหน้า\r\nระบบกุญแจนิรภัย Immobilizer\r\nสัญญาณเตือนระยะถอยหลัง', '02', '1055', '422', '0'),
