('FD470', 'RANGER', 'RANGER OPEN CAB 2.0L Turbo Limited 4x4 6 MT 2018 ', 'เครื่องยนต์:1,996 cc., 180แรงม้า(PS)เครื่องยนต์ใหม่แบบ Turbo ขนาด 2.0 ลิตร  ระบบขับเคลื่อน:ขับเคลื่อนสี่ล้อ Part Time                        \r\nระบบเกียร์:เกียร์ธรรมดา 6MT                                    \r\nเชื้อเพลิงที่ใช้ได้:ดีเซล, ไบโอดีเซล B5ระบบจ่ายน้ำมัน:หัวฉีดไดเร็คอินเจ็คชั่น คอมมอนเรลวัสดุหุ้มเบาะ:กึ่งหนังแท้เบาะปรับไฟฟ้า:มี (ด้านคนขับปรับได้ 8 ทิศทาง)เครื่องเสียง:วิทยุ (ลำโพง 6 จุด), MP3, CD, จอภาพ Touch Screen (8\"), ช่องต่อ Memory Card (SD Card), USB (2 จุด), ช่องต่อ ipod, ช่องต่อ Aux, Bluetooth, ระบบเชื่อมต่อโทรศัพท์ (สั่งงานด้วยเสียง Sync 3)ระบบเบรค ABS (พร้อมระบบกระจายแรงเบรค EBD)Air Bags:คู่หน้า + ด้านข้าง, ม่านนิรภัยกระจกไฟฟ้า:                                                \r\nอุปกรณ์มาตรฐานภายนอก:\r\nล้อแม็ก (18\")\r\nกระจกมองข้างพร้อมไฟเลี้ยว (พร้อมไฟส่องสว่างข้างตัวรถ)\r\nกระจกกรองแสง (เคลือบสีดำ)\r\nไฟตัดหมอก (หน้า)\r\nไฟหน้า HID (โปรเจกเตอร์)\r\nไฟหน้าส่องสว่างอัตโนมัติ (เปิด-ปิด อัตโนมัติ)\r\nระบบไล่ฝ้ากระจกหลัง\r\nปัดน้ำฝนกระจกหน้าแบบพิเศษ (ทำงานอัตโนมัติ)\r\nขนาดยางหน้า-หลัง (265/60 R18)\r\nไฟ Daytime Running Lights\r\nอุปกรณ์มาตรฐานภายใน:\r\nพวงมาลัยหุ้มหนัง\r\nหัวเกียร์หุ้มหนัง\r\nภายในโทนสีดำ\r\nพวงมาลัยปรับสูง-ต่ำได้\r\nเบาะคนขับปรับสูง-ต่ำได้\r\nปลั๊กไฟ 12 โวลท์ (2 ตำแหน่ง และบนพื้นปูกระบะท้าย)\r\nอุปกรณ์มาตรฐานความปลอดภัย:\r\nระบบควบคุมการทรงตัวอัตโนมัติ (ESP)\r\nตัวถังนิรภัย\r\nคานเหล็กเสริมนิรภัย\r\nกระจกนิรภัย\r\nเซ็นทรัลล็อค\r\nไฟเบรกดวงที่ 3\r\nสัญญาณเตือนถอยหลัง (พร้อมกล้องมองภาพ)\r\nสัญญาณกันขโมย\r\nระบบป้องกันก่อนเกิดเหตุ (Roll-over Mitigation ลดความเสี่ยงของการพลิกคว่ำ)\r\nเข็มขัดนิรภัย (ดึงกลับและผ่อนแรงอัตโนมัติ)\r\nพวงมาลัยยุบตัวได้\r\nอุปกรณ์เสริมความปลอดภัยอื่นๆ (ระบบป้องกันล้อหมุนฟรี ASR)\r\nระบบช่วยการออกตัวขณะจอดบนทางลาดชัน (HLA)\r\nอื่นๆ (ระบบควบคุมการทรงตัวขณะลากจูง (Trailer Sway Control), ระบบควบคุมความเร็วขณะลงทางชัน (Hill Descent Control) และระบบควบคุมการบรรทุก (Load Adaptive Control))\r\nอุปกรณ์มาตรฐานความสะดวกสบาย:\r\nCruise Control\r\nกระจกมองข้างปรับ/พับไฟฟ้า\r\nพวงมาลัยพาวเวอร์\r\nแอร์\r\nปรับอากาศอัตโนมัติ (แยกอิสระซ้าย-ขวา)\r\nพวงมาลัยมัลติฟังก์ชั่น\r\nปุ่มควบคุมเครื่องเสียงบนพวงมาลัย\r\nไฟอ่านแผนที่ด้านหน้า\r\nปุ่ม Start/Stop Engine\r\nพนักพิงศีรษะปรับระดับได้\r\nเบาะหลังพับได้\r\nช่องเก็บของ\r\nที่วางแขน\r\nที่วางแก้วน้ำ\r\nช่องแช่เย็น (แบบ Cool Box บริเวณคอนโซลหน้า)', '01', '8323', '427', '1'),
