('HN085', 'รถทัวร์', 'รถทัวร์ ม.3 (ข)', '\r\nม1ก คือ รถปรับอากาศพิเศษชนิดไม่เกิน 24 ที่นั่ง          นิยมเรียกกันว่า วีไอพี 24 ที่นั่งนั่นเอง\r\nม1พ คือ รถปรับอากาศพิเศษชนิดไม่เกิน 32 ที่นั่ง                               วีไอพี 32 ที่นั่ง\r\nม1ข คือ รถปรับอากาศชั้นหนึ่งชนิดไม่เกิน 40 ที่นั่ง                              รถป.1\r\nม2 คือ รถปรับอากกาศชั้นสองชนิดไม่เกิน 50 ที่นั่ง                              รถป.2 ไม่มีห้องน้ำ\r\nม4ก คือ รถปรับอากาศพิเศษ(2ชั้น)ชนิดไม่เกิน 32 ที่นั่ง                        วีไอพี24ที่นั่ง 2 ชั้น\r\nม4พ คือ รถปรับอากาศพิเศษ(2ชั้น)ชนิดไม่เกิน 42 ที่นั่ง                        วีไอพี 32 ที่นั่ง 2 ชั้น\r\nม4ข คือ รถปรับอากาศชั้นหนึ่ง(2ชั้น)ชนิดไม่เกิน 50 ที่นั่ง                      รถป.1 2 ชั้น\r\nม4ค คือ รถปรับอากาศชั้นสอง(2ชั้น)ชนิดไม่เกิน 55 ที่นั่ง                      รถป.2 2ชั้น ไม่มีห้องน้ำ  (แต่บางเจ้าก็มีห้องน้ำ', '04', '1405', '538', '0'),
('HN142', 'รถทัวร์', 'ม.1 (ข)', 'รับทัวร์ปปรับอากาศ ระบบช่วงล่างแบบถุงลม แบบ4ล้อยาง6เส้น เครื่องยนต์ 310 แรงม้า\r\nมีห้องน้ำในตัวรถ\r\n', '04', '1461', '538', '0'),
('HN147', 'รถทัวร์', 'ม.4(ข)', 'รถบัส ม.4(ข) แบบสองชั้นเครื่องยนต์320 แรงม้า แชสซีเก่าขึ้นโครงใหม่ จดทะเบียนใหม่ ช่วงล่างแบบถุงลม มีห้องน้ำในรถ ระบบเครื่องเสียงไฟฟ้าและเครื่องปรับอากาศแบบไฟฟ้า\r\n', '04', '1466', '538', '0'),
('HN171', 'รถทัวร์', 'ม.2 (ค)', '\r\nรถบัสเล็กขนาด 25 ที่นั่ง ไม่มีห้องน้ำ ช่วงล่างระบบแหนบ\r\nม1ก คือ รถปรับอากาศพิเศษชนิดไม่เกิน 24 ที่นั่ง          นิยมเรียกกันว่า วีไอพี 24 ที่นั่งนั่นเอง\r\nม1พ คือ รถปรับอากาศพิเศษชนิดไม่เกิน 32 ที่นั่ง                               วีไอพี 32 ที่นั่ง\r\nม1ข คือ รถปรับอากาศชั้นหนึ่งชนิดไม่เกิน 40 ที่นั่ง                              รถป.1\r\nม2 คือ รถปรับอากกาศชั้นสองชนิดไม่เกิน 50 ที่นั่ง                              รถป.2 ไม่มีห้องน้ำ\r\nม4ก คือ รถปรับอากาศพิเศษ(2ชั้น)ชนิดไม่เกิน 32 ที่นั่ง                        วีไอพี24ที่นั่ง 2 ชั้น\r\nม4พ คือ รถปรับอากาศพิเศษ(2ชั้น)ชนิดไม่เกิน 42 ที่นั่ง                        วีไอพี 32 ที่นั่ง 2 ชั้น\r\nม4ข คือ รถปรับอากาศชั้นหนึ่ง(2ชั้น)ชนิดไม่เกิน 50 ที่นั่ง                      รถป.1 2 ชั้น\r\nม4ค คือ รถปรับอากาศชั้นสอง(2ชั้น)ชนิดไม่เกิน 55 ที่นั่ง                      รถป.2 2ชั้น ไม่มีห้องน้ำ  (แต่บางเจ้าก็มีห้องน้ำ', '04', '1490', '538', '0'),
('HN186', 'รถทัวร์', 'ม.2 (จ)', 'รถมินิบัส 4ล้อ ยาง6เส้น ภายในปรับอากาศ จำนวน 19 ที่นั่ง ไม่มีสุขา\r\n', '04', '1505', '538', '0'),
