('IT0001', 'รถทัวร์', 'ม3(ข)', 'รถทัวร์โดยสารขนาดใหญ่ไม่ประจำทาง ชั้นเดียว เป็นรถประกอบจากอู่ต่อรถ ระบบปรับอากาศมีทั้งแบบระบบแอร์และแบบมีแต่พัดลม\r\n(แบบพัดลมให้ลดยอดจัดลงจากยอดจัดไพลิส150,000)\r\n', '04', '13378', '1641', '0'),
('JD001', '5610', '5610 รถไถ', 'หากไม่ทราบปีจดทะเบียนจริง(ค.ศ.)ให้ใช้ยอดจัดปีผลิต\r\nเลขโครง PY5610 เครื่องดีเซล 75 แรง\r\nรถแทรกเตอร์ รุ่น5610 MFWD\r\nระบบขับเคลื่อน4 WD\r\nแบบเครื่องยนต์	 	ดีเซล3สูบ เทอร์โบชาร์ท\r\nไดเร็คอินเจคชั่น,โรตารี่ปั้ม, \r\nระบายความร้อนด้วยน้ำ\r\nปริมาตรกระบอกสูบn/a.\r\nความกว้างกระบอกสูบxช่วงชักn/a.\r\nอัตราส่วนแรงอัดn/a.\r\nแรงม้าสูงสุด	75 แรงม้า/2,400รอบ/นาที\r\nระบบเกียร์เดินหน้า9เกียร์, ถอยหลัง3เกียร์\r\nระบบพวงมาลัย	 	พาวเวอร์(Power Steering)\r\nระบบคลัตช์คลัตช์แบบคู่\r\nระบบเบรกแบบจานเบรกแช่ในน้ำมันพร้อมวาล์วเบรก\r\nระบบควบคุมแขนยกไฮดรอลิค, ปั้มน้ำมัน46ลิตร/นาที\r\nน้ำหนักยกสูงสุดที่ปลายแขนยก	 	2,000 กก.\r\nความเร็วรอบPTO /รอบเครื่องยนต์	 	540 @2,376 ERPM \r\n540 @1,705 ERPM\r\nความจุถังน้ำมัน 68 ลิตร\r\nระบบไฟฟ้า	 100 แอมป์ชั่วโมง,\r\nแบตเตอรี่ 12 โวลท์ 40แอมป์\r\nขนาดล้อยาง	ล้อหน้า 11.2 x 24 \r\nล้อหลัง 16.9 x 30\r\nขนาดรถ ยาว x กว้าง x สูง 3,620 x 1,860 x n/a. มม.\r\nระดับต่ำสุดจากพื้น 410 มม.\r\nรัศมีวงเลี้ยวแคบสุด 3,550 มม.\r\nระยะช่วงล้อ	2,060 มม.\r\nน้ำหนักรถ 	2,425 กก.', '24', '2087', '636', '0'),
